// services/trustedService.js
import API from '../lib/axios';

export const fetchTrustedPersons = () => API.get('/api/trusted');
export const addTrustedPerson = (formData) => API.post('/api/trusted', formData);
export const deleteTrustedPerson = (id) => API.delete(`/api/trusted/${id}`);
